import React,{useState, useRef} from "react";

import { Form, FormCheck, FormLabel, FormControl, Button } from "react-bootstrap";
import "./FilterEvents.css";
const FilterEvents = (props) => {
  let enteredDate1;

  return (
    <div className="filterSportsRadio">
      <div className="sportsContainer">
          <FormLabel><h5>Sport:</h5></FormLabel>
          <FormCheck type="radio" label="Tennis" name="group1" />
          <FormCheck type="radio" label="Football" name="group1" />
          <FormCheck type="radio" label="Jogging" name="group1" />
      </div>
      <div className="sportsContainer">
          <FormLabel><h5>Skill level:</h5></FormLabel>
          <FormCheck type="radio" label="Beginner" name="group2" />
          <FormCheck type="radio" label="Intermediate" name="group2" />
          <FormCheck type="radio" label="Pro" name="group2" />
      </div>
      <div className="sportsContainer">
        <Form>
          <FormLabel><h5>Between:</h5></FormLabel>
          <FormControl type="date" ref={enteredDate1} style={{'width':'200px'}}/>
          <FormControl className="my-1" type="date" min = {enteredDate1} max="2022-02-01"/>
          <Button> Submit</Button>
        </Form>
      </div>
    </div>
  );
};

export default FilterEvents;
